import axios from "axios";
import { configHeader } from "../components/functions/configHeader";

var env = require('../env');

var endpoint = env.endpoint;

var listAgent = function listAgent() {
  return axios.get("".concat(endpoint, "/agent"), configHeader());
};

var getAgentFromId = function getAgentFromId(id) {
  return axios.get("".concat(endpoint, "/agent/").concat(id), configHeader());
};

var createAgent = function createAgent(data) {
  //console.log('data : ' + data.password);
